import react from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';

import logo_user from './../logo/user_profile.png';
import logo_facebook from './../logo/facebook.svg';
import logo_github from './../logo/github.png';
import logo_linkedIn from './../logo/linkedIn.png';
import logo_location from './../logo/location.png';
import logo_email from './../logo/email.png';
import logo_call from './../logo/call.png';

import Navigation from './../components/navigation';
import About from './../components/about';
import Education from './../components/education';
import Projects from './../components/projects';
import Skills from './../components/skills';

function MainPage() {
    return (
        <>
            <div className="sub-container-1">
                <img className="user-logo" src={logo_user} />
                <div className="user-profile">
                    <h1>Asad Hussain</h1>
                    <p>Electronics Engineer</p>
                    <p>PEC No: ELECTRO/7836</p>
                </div>
                <div className="links-group">
                    <img src={logo_linkedIn} />
                    <img src={logo_github} />
                    <img src={logo_facebook} />
                </div>
                <div className="details">
                    <div className="location">
                        <img src={logo_location} />
                        <p>Karachi, Pakistan</p>
                    </div>
                    <div className="location">
                        <img src={logo_email} />
                        <p>asad.h1998@yahoo.com</p>
                    </div>
                    <div className="location">
                        <img src={logo_call} />
                        <p>+92 311 2425100</p>
                    </div>
                </div>
            </div>
            <div className="sub-container-2">
                <Navigation />
                <Router> 
                    <Switch>                   
                        <Route exact path="/">
                            <Projects />
                        </Route>
                    </Switch>
                </Router>
                {/* <About /> */}
                {/* <Education /> */}
                {/* <Projects /> */}
                {/* <Skills /> */}
            </div>
        </>
    );
}

export default MainPage;
